import React from 'react';

import { BannerContainer, BannerTextBackground, BannerText } from './banner.styles';

const Banner = () => (
  <BannerContainer>
    <BannerTextBackground>
      <BannerText>HYBRID SOLUTIONS | MIXING, MASTERING and PRODUCTION | Beats By DJ Definition and more</BannerText>
    </BannerTextBackground>
  </BannerContainer>

);

export default Banner;
